            <img src={process.env.PUBLIC_URL+ item.img} className="card-img-top" alt={item.title}/>
                <div className="card-body text-center">
                    <h5 className="card-title">{item.title}</h5>
                    <p className="lead">{item.price}â‚¬</p>
